#define MOD 998244353

pair<long long, long long> dp[20][2][1024][11];

pair<long long, long long> recurr(const string &num, int pos, bool tight, int mask, int cnt, int k) {

    if (pos == num.size()) 
        return (cnt <= k) ? make_pair(1, 0) : make_pair(0, 0);

    if (dp[pos][tight][mask][cnt] != make_pair(-1LL, -1LL))
        return dp[pos][tight][mask][cnt];

    int limit = (tight) ? (num[pos] - '0') : 9;
    pair<long long, long long> ans = {0, 0};

    for (int digit = 0; digit <= limit; digit++) {
        int newmask = mask, newcnt = cnt;

        if (!(mask & (1 << digit))) {
            newmask |= (1 << digit);
            newcnt++;
        }

        if (newcnt <= k) {
            pair<long long, long long> res = recurr(num, pos + 1, tight && (digit == limit), newmask, newcnt, k);

            ans.first = (ans.first + res.first) % MOD; 
            ans.second = (ans.second + res.second + res.first * digit * (long long)powl(10, num.size() - pos - 1) % MOD) % MOD;
        }
    }

    return dp[pos][tight][mask][cnt] = ans;
}

long long f(long long N, int k) {
    string num = to_string(N);
    memset(dp, -1, sizeof(dp)); 
    return recurr(num, 0, true, 0, 0, k).second;
}

long long solve(long long L, long long R, int k) {
    long long sumR = f(R, k);
    long long sumL = f(L - 1, k);
    return (sumR - sumL + MOD) % MOD;
}

int main() {
    long long L, R;
    int k;
    cin >> L >> R >> k;
    cout << solve(L, R, k) << endl;
    return 0;
}